import React from "react";
import ReactDOM from "react-dom";

import GiftBoxAnimation from "./GiftBoxAnimation";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <GiftBoxAnimation />
  </React.StrictMode>,
  rootElement
);
